import fetch from 'isomorphic-unfetch';

const Posts = (props) => {
  console.log(props)
  return (
    <div>
      Posts
    </div>
  )
}

Posts.getInitialProps = async function(){
  const res = await fetch('/api/posts')
  const posts = await res.json()
  return posts
}


export default Posts
